}
div.jGrowl div.suc {
	height:25px;
	line-height:25px;
	_width:200px;
	display:block;
	border:1px solid #76f06d;
	background:#bef9ca;
} 
div.jGrowl div.suc .jGrowl-left{
	overflow:hidden;
	height:25px;
}
