div.jGrowl div.suc .message{white-space:nowrap;  height:25px;  overflow:hidden; color:#4A4A4A; font-weight:bold;}


div.jGrowl div.err {
	height:25px;
	line-height:25px;
	_width:200px;
	display:block;
	border:1px solid #F0C36D;
	background:#F9EDBE;
} 
